import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";
function Home()
{
const a=useSelector((state)=>state.login)
const navigate=useNavigate()
useEffect(()=>{
    console.log(a)
    if(a.signed!==true)
    {
        navigate('/')
    }
})
 if(a.signed===true){
    return(
        <h1>Hello {a.user}</h1>
    )
}}
export default Home;
